import React, { useState } from 'react';
import './ProfilePage.css';

const ProfilePage = () => {
	const [onProfile, setOnProfile] = useState({
		onProfile: true
	});
	return (
		<div className='profileContainer'>
			<div className='profileImg'>
				<div>
					<img src='https://a0.muscache.com/defaults/user_pic-225x225.png?v=3' />
				</div>
			</div>
			<div className='profileContent'>
				<h2>Profile Page</h2>
				<div className='profileHeader'>
					ProfileHeader
					<div>
						Toggle Between Guest & Host (if
						applicable)
					</div>
				</div>
				<div className='profileMain'>
					<div className='guestContent'>
						Guest Content
					</div>
					<div className='hostContent'>
						Host Content (if applicable)
					</div>
				</div>
			</div>
		</div>
	);
};

export default ProfilePage;
